"""
Ta sẽ biến đổi ảnh ban đầu thành ảnh có kích thước bằng scale_percent ban đầu.
Ví dụ nếu ta chọn scale_pixel =  50, khi đó với ảnh đầu vào là 80 x 80 thì lúc này
ta sẽ có ảnh là 40 x 40.
Tiếp theo để tạo input cho encoder, ta sẽ lại phóng đại hình ảnh có kích thước 40 x 40
thành 80 x 80 bằng interpolation.
"""
def pixalate_image(image, scale_percent = 50):
  width = int(image.shape[1] * scale_percent / 100)
  height = int(image.shape[0] * scale_percent / 100)
  dim = (width, height)

  small_image = cv2.resize(image, dim, interpolation = cv2.INTER_AREA)
  
  # scale back to original size
  width = int(small_image.shape[1] * 100 / scale_percent)
  height = int(small_image.shape[0] * 100 / scale_percent)
  dim = (width, height)

  low_res_image = cv2.resize(small_image, dim, interpolation = cv2.INTER_AREA)

  return low_res_image

train_x_px = []

for i in range(train_x.shape[0]):
  temp = pixalate_image(train_x[i,:,:,:])
  train_x_px.append(temp)

train_x_px = np.array(train_x_px)


val_x_px = []

